import React from "react";
import './nav.scss'
class Menu extends React.Component {
    render() {
        return (
            <>
                <div>Hello navigation</div>
                <div class="topnav">
                    <a class="active" href="#home">Home</a>
                    <a href="#news">Todo</a>
                    <a href="#contact">about</a>
                    <a href="#about">About</a>
                </div>
            </>
        )
    }
}

export default Menu
